dscape'=>'Beautiful landscape','Thanks for testing Gutenberg!'=>'Thanks for testing Gutenberg!','Help build Gutenberg'=>'Help build Gutenberg','If you want to learn more about how to build additional blocks, or if you are interested in helping with the project, head over to the <a href="%s">GitHub repository</a>.'=>'If you want to learn more about how to build additional blocks, or if you are interested in helping with the project, head over to the <a href="%s">GitHub repository</a>.','The WordPress community'=>'The WordPress community','Code is Poetry'=>'Code is Poetry','You can build any block you like, static or dynamic, decorative or plain. Here&#8217;s a pullquote block:'=>'You can build any block you like, static or dynamic, decorative or plain. Here&#8217;s a pullquote block:','Any block can opt into these alignments. The embed block has them also, and is responsive out of the box:'=>'Any block can opt into these alignments. The embed block has them also, and is responsive out of the box:','The above is a gallery with just two images. It&#8217;s an easier way to create visually appealing layouts, without having to deal with floats. You can also easily convert the gallery back to individual images again, by using the block switcher.'=>'The above is a gallery with just two images. It&#8217;s an easier way to create visually appealing layouts, without having to deal with floats. You can also easily convert the gallery back to individual images again, by using the block switcher.','Sure, the full-wide image can be pretty big. But sometimes the image is worth it.'=>'Sure, the full-wide image can be pretty big. But sometimes the image is worth it.','Accessibility is important &mdash; don&#8217;t forget image alt attribute'=>'Accessibility is important &ndash; don&#8217;t forget image alt attribute','If you combine the new <strong>wide</strong> and <strong>full-wide</strong> alignments with galleries, you can create a very media rich layout, very quickly:'=>'If you combine the new <strong>wide</strong> and <strong>full-wide</strong> alignments with galleries, you can create a very media rich layout, very quickly:','Media Rich'=>'Media Rich','You can change the amount of columns in your galleries by dragging a slider in the block inspector in the sidebar.'=>'You can change the amount of columns in your galleries by dragging a slider in the block inspector in the sidebar.','Blocks can be anything you need. For instance, you may want to add a subdued quote as part of the composition of your text, or you may prefer to display a giant stylized one. All of these options are available in the inserter.'=>'Blocks can be anything you need. For instance, you may want to add a subdued quote as part of the composition of your text, or you may prefer to display a giant stylised one. All of these options are available in the inserter.','The information corresponding to the source of the quote is a separate text field, similar to captions under images, so the structure of the quote is protected even if you select, modify, or remove the source. It&#8217;s always easy to add it back.'=>'The information corresponding to the source of the quote is a separate text field, similar to captions under images, so the structure of the quote is protected even if you select, modify, or remove the source. It&#8217;s always easy to add it back.','Matt Mullenweg, 2017'=>'Matt Mullenweg, 2017','The editor will endeavor to create a new page and post building experience that makes writing rich posts effortless, and has “blocks” to make it easy what today might take shortcodes, custom HTML, or “mystery meat” embed discovery.'=>'The editor will endeavour to create a new page and post building experience that makes writing rich posts effortless, and has “blocks” to make it easy what today might take shortcodes, custom HTML, or “mystery meat” embed discovery.','A huge benefit of blocks is that you can edit them in place and manipulate your content directly. Instead of having fields for editing things like the source of a quote, or the text of a button, you can directly change the content. Try editing the following quote:'=>'A huge benefit of blocks is that you can edit them in place and manipulate your content directly. Instead of having fields for editing things like the source of a quote, or the text of a button, you can directly change the content. Try editing the following quote:','Visual Editing'=>'Visual Editing','And <em>Lists</em> like this one of course :)'=>'And <em>Lists</em> like this one of course :)','Layout blocks, like Buttons, Hero Images, Separators, etc.'=>'Layout blocks, like Buttons, Hero Images, Separators, etc.','Embeds, like YouTube, Tweets, or other WordPress posts.'=>'Embeds, like YouTube, Tweets, or other WordPress posts.','Galleries'=>'Galleries','Images &amp; Videos'=>'Images and Videos','Text &amp; Headings'=>'Text and Headings','Go give it a try, you may discover things WordPress can already add into your posts that you didn&#8217;t know about. Here&#8217;s a short list of what you can currently find there:'=>'Go give it a try, you may discover things WordPress can already add into your posts that you didn&#8217;t know about. Here&#8217;s a short list of what you can currently find there:','Imagine everything that WordPress can do is available to you quickly and in the same place on the interface. No need to figure out HTML tags, classes, or remember complicated shortcode syntax. That&#8217;s the spirit behind the inserter—the <code>(+)</code> button you&#8217;ll see around the editor—which allows you to browse all available content blocks and add them into your post. Plugins and themes are able to register their own, opening up all sort of possibilities for rich editing and publishing.'=>'Imagine everything that WordPress can do is available to you quickly and in the same place on the interface. No need to figure out HTML tags, classes, or remember complicated shortcode syntax. That&#8217;s the spirit behind the inserter—the <code>(+)</code> button you&#8217;ll see around the editor—which allows you to browse all available content blocks and add them into your post. Plugins and themes are able to register their own, opening up all sort of possibilities for rich editing and publishing.','The <em>Inserter</em> Tool'=>'The <em>Inserter</em> Tool','Try selecting and removing or editing the caption, now you don&#8217;t have to be careful about selecting the image or other text by mistake and ruining the presentation.'=>'Try selecting and removing or editing the caption, now you don&#8217;t have to be careful about selecting the image or other text by mistake and ruining the presentation.','If your theme supports it, you&#8217;ll see the "wide" button on the image toolbar. Give it a try.'=>'If your theme supports it, you&#8217;ll see the "wide" button on the image toolbar. Give it a try.','Handling images and media with the utmost care is a primary focus of the new editor. Hopefully, you&#8217;ll find aspects of adding captions or going full-width with your pictures much easier and robust than before.'=>'Handling images and media with the utmost care is a primary focus of the new editor. Hopefully, you&#8217;ll find aspects of adding captions or going full-width with your pictures much easier and robust than before.','A Picture is Worth a Thousand Words'=>'A Picture is Worth a Thousand Words','Headings are separate blocks as well, which helps with the outline and organization of your content.'=>'Headings are separate blocks as well, which helps with the outline and organisation of your content.','... like this one, which is right aligned.'=>'... like this one, which is right aligned.','What you are reading now is a <strong>text block</strong> the most basic block of all. The text block has its own controls to be moved freely around the post...'=>'What you are reading now is a <strong>text block</strong> the most basic block of all. The text block has its own controls to be moved freely around the post...','The goal of this new editor is to make adding rich content to WordPress simple and enjoyable. This whole post is composed of <em>pieces of content</em>—somewhat similar to LEGO bricks—that you can move around and interact with. Move your cursor around and you&#8217;ll notice the different blocks light up with outlines and arrows. Press the arrows to reposition blocks quickly, without fearing about losing things in the process of copying and pasting.'=>'The goal of this new editor is to make adding rich content to WordPress simple and enjoyable. This whole post is composed of <em>pieces of content</em> – somewhat similar to LEGO bricks – that you can move around and interact with. Move your cursor around and you&#8217;ll notice the different blocks light up with outlines and arrows. Press the arrows to reposition blocks quickly, without fearing about losing things in the process of copying and pasting.','Of Mountains &amp; Printing Presses'=>'Of Mountains and Printing Presses','Welcome to the Gutenberg Editor'=>'Welcome to the Gutenberg Editor','Unique identifier for the font face.'=>'Unique identifier for the font face.','The page number requested is larger than the number of pages available.'=>'The page number requested is larger than the number of pages available.','Small'=>'Small','https://wordpress.org/support/plugin/gutenberg/'=>'https://wordpress.org/support/plugin/gutenberg/','Support'=>'Support','No comments to show.'=>'No comments to show.','%1$s on %2$s'=>'%1$s on %2$s','Select Post'=>'Select Post','Select Week'=>'Select Week','Select Day'=>'Select Day','Select Month'=>'Select Month','Select Year'=>'Select Year','Archives'=>'Archives','Large'=>'Large','block descriptionAdd a block that displays content pulled from other sites, like Twitter or YouTube.'=>'Add a block that displays content pulled from other sites, like Twitter or YouTube.','Pagination'=>'Pagination','Block'=>'Block','(no title)'=>'(no title)','C